import React from "react";

function ContactCard(props) {
    console.log(props)
    return(
        <div className="contacts-card">
                <img src={props.imgUrl} alt="ionut"/>
                <h3>{props.name}</h3>
                <p>Phone: {props.phone}</p>
                <p>Email: {props.email}</p>
            </div>
    )
}
export default ContactCard
